'use strict';
class RawAccountsProvider {
    manager;
    static create(manager) {
        let result;
        result = new RawAccountsProvider();
        result.manager = manager;
        return result;
    }
    getAccountById(accountId) {
        return this.manager.getRawAccountById(accountId);
    }
    getAllAccounts() {
        let allAccountInfo, i, result;
        allAccountInfo = this.manager.getAccountsInfo();
        result = new Array(allAccountInfo.length);
        for (i = 0; i <= allAccountInfo.length - 1; i += 1) {
            result[i] = this.manager.getAccountInternal(allAccountInfo[i]);
        }
        return result;
    }
}
module.exports = RawAccountsProvider
